import styled from 'styled-components';
import './Home.css';
import './artist.js';
import './album.js';
import './genre.js';
import './genre_album.js';
import './tracks.js';

import React from 'react';
import logo from "./spoti.png";
import { Link } from 'react-router-dom';



const StyledImg = styled.img`
  width: 150px;


`;

function GenresAlbums(){

    return (
        <div className='home'>
        <StyledImg src={logo} alt="Logo"></StyledImg>
        <div className='home2'>
        <Link to='./artist.js/'>Artists</Link>
        <Link to='./album.js/'>Albums</Link>
        <Link to='./genre.js/'>Genres</Link>
        <Link to='./tracks.js/'>Tracks</Link>
        <Link to='./genre_album.js/'>Albums Genres</Link>
        </div>
        <div className='img'>
        </div>
        </div>
    );
}

export default GenresAlbums;
